  bmlfonProcess() {
    if (!this.appUtility.mbWrite) {
      this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
      return;
    }
    ;
    let pbResult = true;
    let pArrGrid = [];
    this.mArrGrid.forEach(ele => {
      if (ele.Sel) {
        pArrGrid.push(ele);
      }
    });
    pbResult = this.bmlfonValidateFormData();
    if (pbResult) {
      this.mbIsLoading = true;
      let reqData = {
        JSON: JSON.stringify({
          HeaderData: [this.mObjModel],
          DetailData: pArrGrid,
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.objService.bmlfonProcessApplyPayment(reqData).subscribe(res => {
        this.mbIsLoading = false;
        if (res == null) {
          this.objToastService.notifyError(this.appUtility.bmgfonTranslate('COMMON.MSG.SERVERERROR'));
        } else if (res.Response[0].ResponseText != "") {
          {
            this.msMsgData.screenName = this.msScreenName;
            this.msMsgData.Data = res.Response[0].ResponseText;
            this.mbBulkResponseView = true;
            this.msReportDialog = res.Response[0].ResponseText;
            if (this.msReportDialog.length > this.mnumResponseLen) {
              this.bmlfReportModal('open');
              this.mbBulkResponseView = true;
            } else {
              this.objToastService.notifySuccess(res.Response[0].ResponseText);
            }
          }
        } else if (res.Response[0].ErrorCode != "") {
          this.objToastService.notifySuccess(res.Response[0].ErrorCode);
        }
      }, err => {
        console.log(err);
        this.mbIsLoading = false;
      });
    }
  }
