  bmlfonSaveLookupField(pobjEvent) {
    this.mbIsLookupModal = false;
    if (pobjEvent.field == this.msLookupCaptionForCurrency) {
      let psPrevCurrency = this.mObjModel.CurrencyKey;
      this.mObjModel.CurrencyKey = pobjEvent.value["Curr_Id"];
      if (psPrevCurrency != this.mObjModel.CurrencyKey) {
        this.bmlfonClearControl();
        this.bmlfonGetUnappliedAmount();
      }
    } else if (pobjEvent.field == this.msLookupCaptionForBatchSeries) {
      this.mObjModel.BatchSeries = pobjEvent.value["Series"];
    } else if (pobjEvent.field == this.msLookupCaptionForCustomer) {
      this.mObjModel.Vend_CustKey = pobjEvent.value["Customer_Key"];
      this.msDescription = pobjEvent.value["Customer_Name"];
      this.mObjModel.CurrencyKey = pobjEvent.value["Currency_Key"];
      /* Abhay/07-July-2020/Bug# 140932 */
      this.bmlfonGetUnappliedAmount();
    } else if (pobjEvent.field == this.msLookupCaptionForVendor) {
      this.mObjModel.Vend_CustKey = pobjEvent.value["Vendor_Key"];
      this.msDescription = pobjEvent.value["VendorName"];
      this.mObjModel.CurrencyKey = pobjEvent.value["Currency_Key"];
      /* Abhay/07-July-2020/Bug# 140932 */
      this.bmlfonGetUnappliedAmount();
    } else if (pobjEvent.field == this.msLookupCaptionForInvoice) {
      this.mArrGrid = [];
      this.mObjModel.PaymentNo = pobjEvent.value["DocNo"];
      this.mnAmount = pobjEvent.value["DocAmount"];
      this.mObjModel.RemainingAmount = pobjEvent.value["RemainingAmt"];
      this.mdtApplyDate = this.appUtility.bmlfSetDateAsDateFormat(pobjEvent.value["AplDate"]);
      this.mdtPaymentDate = this.appUtility.bmlfSetDateAsDateFormat(pobjEvent.value["AplDate"]);
      this.mdtDueDate = this.appUtility.bmlfSetDateAsDateFormat(pobjEvent.value["AplDate"]);
      this.bmlfonGetVoucherDebitDetails(this.msReferenceType, this.mObjModel.Vend_CustKey, this.mObjModel.CurrencyKey, this.msDocumentNo, this.mdtPaymentDate, this.mObjModel.VendorCustomer);
    } else if (pobjEvent.field == this.msLookupCaptionForPaymentNo) {
      this.mArrGrid = [];
      this.mObjModel.PaymentNo = pobjEvent.value["PaymentNo"]; //In case of Vendor
      /* Abhay/07-July-2020/Bug# 140981 */
      this.mdtPaymentDate = this.appUtility.bmlfSetDateAsDateFormat(pobjEvent.value["PaymentDate"]);
      this.bmlfonGetPaymentDetails();
    } else if (pobjEvent.field == this.msLookupCaptionForPaymentLine) {
      this.mArrGrid = [];
      this.mObjModel.PaymentLineno = pobjEvent.value["RowNo"];
      this.msReferenceType = pobjEvent.value["RefType"];
      if (this.mbTCSApplicable) {
        if (this.msReferenceType == 'Advance') this.mbDisableTCsGridField = false;
      }
      this.msDocumentNo = pobjEvent.value["DocNo"];
      /* Abhay/07-july-2020/Bug# 141487 */
      this.mdtDueDate = this.appUtility.bmlfSetDateAsDateFormat(pobjEvent.value["DueDate"]);
      this.mnDocumentAmount = pobjEvent.value["DocAmount"];
      this.mnAmount = pobjEvent.value["Amount"];
      this.mnDiscount = pobjEvent.value["Discount"];
      this.bmlfonGetUnadjustedAmount(this.mObjModel.PaymentNo, this.mObjModel.PaymentLineno, this.mbOptionPayment, this.mObjModel.VendorCustomer);
      this.bmlfonGetVoucherDebitDetails(this.msReferenceType, this.mObjModel.Vend_CustKey, this.mObjModel.CurrencyKey, this.msDocumentNo, this.mdtPaymentDate, this.mObjModel.VendorCustomer);
      if (this.mbTCSApplicable) {
        this.bmlfonGetUnadjustedTCSAmount(this.mObjModel.PaymentNo, this.mObjModel.PaymentLineno, this.mbOptionPayment, this.mObjModel.VendorCustomer);
      }
    } else if (pobjEvent.field == this.msLookupCaptionForVendorDebit) {
      this.mArrGrid = [];
      this.mObjModel.PaymentNo = pobjEvent.value["DocNo"];
      this.mnAmount = pobjEvent.value["DocAmount"];
      this.mObjModel.RemainingAmount = pobjEvent.value["RemainingAmt"];
      this.mdtApplyDate = this.appUtility.bmlfSetDateAsDateFormat(pobjEvent.value["AplDate"]);
      this.mdtPaymentDate = this.appUtility.bmlfSetDateAsDateFormat(pobjEvent.value["AplDate"]);
      this.bmlfonGetVoucherDebitDetails(this.msReferenceType, this.mObjModel.Vend_CustKey, this.mObjModel.CurrencyKey, this.msDocumentNo, this.mdtPaymentDate, this.mObjModel.VendorCustomer);
      if (this.mbTCSApplicable) {
        this.bmlfonGetUnadjustedTCSAmount(this.mObjModel.PaymentNo, this.mObjModel.PaymentLineno, false, this.mObjModel.VendorCustomer);
      }
    }
  }
  // Set Lookup Value Column
  bmlfGetInputColumn(psfield) {
    if (psfield == this.msLookupCaptionForBatchSeries) {
      return 'Series';
    } else if (psfield == this.msLookupCaptionForCurrency) {
      return 'Curr_Id';
    } else if (psfield == this.msLookupCaptionForCustomer) {
      return 'Customer_Key';
    } else if (psfield == this.msLookupCaptionForVendor) {
      return 'Vendor_Key';
    } else if (psfield == this.msLookupCaptionForInvoice || psfield == this.msLookupCaptionForVendorDebit) {
      return 'DocNo';
    } else if (psfield == this.msLookupCaptionForPaymentNo) {
      return 'PaymentNo';
    } else if (psfield == this.msLookupCaptionForPaymentLine) {
      return 'RowNo';
    }
  }
  //Return Model Field
  bmlfGetModelField(psfield, eleId) {
    if (psfield == this.msLookupCaptionForBatchSeries) {
      return "BatchSeries";
    } else if (psfield == this.msLookupCaptionForCurrency) {
      return 'CurrencyKey';
    } else if (psfield == this.msLookupCaptionForCustomer || psfield == this.msLookupCaptionForVendor) {
      return 'Vend_CustKey';
    } else if (psfield == this.msLookupCaptionForInvoice || psfield == this.msLookupCaptionForPaymentNo || psfield == this.msLookupCaptionForVendorDebit) {
      return 'PaymentNo';
    } else if (psfield == this.msLookupCaptionForPaymentLine) {
      return 'PaymentLineno';
    }
  }
  bmlfonCloseLookupModal(pobjData) {
    this.mbIsLookupModal = pobjData.isLookupModal;
    if (pobjData.eleId != null) {
      let psInputKey = this.bmlfGetInputColumn(pobjData.field);
      let parrFilterData = [];
      if (psInputKey) {
        parrFilterData = pobjData.gridData.filter(obj => obj[psInputKey].toUpperCase() == pobjData.searchValue.toUpperCase());
      }
      if (parrFilterData.length == 0) {
        let psModelField = this.bmlfGetModelField(pobjData.field, pobjData.eleId);
        this.mObjModel[psModelField] = '';
      }
      document.getElementById(pobjData.eleId).focus();
    }
  }
