  bmlfonGetPaymentDetails() {
    let psARAP = 'AP';
    if (this.msType == "Customer") {
      psARAP = 'AR';
    }
    this.mObjModelPaymentDetails.PaymentNo = this.mObjModel.PaymentNo;
    let reqData = {
      JSON: JSON.stringify({
        HeaderData: [{
          PaymentNo: this.mObjModel.PaymentNo,
          ARAP: psARAP
        }],
        Response: [{
          "ResponseText": "",
          "ErrorCode": ""
        }]
      })
    };
    this.objService.bmlfonGetPaymentDetails(reqData).subscribe(res => {
      if (res.HeaderData.length > 0) {
        /*Abhay/22-Aug-2020/Bug# 140944 */
        if (res.HeaderData.length > 1) {
          this.mObjModel.PaymentLineno = undefined;
          this.mdtDueDate = new Date();
          this.mnDocumentAmount = 0.00;
          this.mnAmount = 0.00;
          this.mnDiscount = 0.00;
          this.msReferenceType = "";
          this.msDocumentNo = "";
        } else {
          this.mdtDueDate = new Date(res.HeaderData[0].DueDate);
          this.mnDocumentAmount = Number(res.HeaderData[0].DocAmount);
          this.mnAmount = Number(res.HeaderData[0].Amount);
          this.mnDiscount = Number(res.HeaderData[0].Discount);
          this.msReferenceType = res.HeaderData[0].RefType;
          this.msDocumentNo = res.HeaderData[0].DocNo;
          if (res.HeaderData[0].RowNo == undefined) {
            this.mObjModel.PaymentLineno = undefined;
          } else {
            this.mObjModel.PaymentLineno = Number(res.HeaderData[0].RowNo);
          }
          this.bmlfonGetUnadjustedAmount(this.mObjModel.PaymentNo, this.mObjModel.PaymentLineno, this.mbOptionPayment, this.mObjModel.VendorCustomer);
          this.bmlfonGetVoucherDebitDetails(this.msReferenceType, this.mObjModel.Vend_CustKey, this.mObjModel.CurrencyKey, this.msDocumentNo, this.mdtPaymentDate, this.mObjModel.VendorCustomer);
          if (this.mbTCSApplicable) {
            this.bmlfonGetUnadjustedTCSAmount(this.mObjModel.PaymentNo, this.mObjModel.PaymentLineno, this.mbOptionPayment, this.mObjModel.VendorCustomer);
          }
        }
      }
    }, err => {
      console.log(err);
    });
  }
