  /* Abhay/10-July-2020/Bug#141825 */
  bmlfonValidateFormData() {
    let pbSuccess = true;
    let piRowIndex = 1;
    this.mArrGrid.forEach(ele => {
      if (ele.Select) {
        if (ele.NewTypeKey != "" && ele.NewBoxNumber == "") {
          if (pbSuccess) {
            this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key7') + piRowIndex.toString());
          }
          pbSuccess = false;
          return pbSuccess;
        }
      }
      piRowIndex += 1;
    });
    return pbSuccess;
  }
  /* Abhay/10-July-2020/Bug#141834 */
  bmlfonValidateProcessData() {
    let pbSuccess = true;
    if (this.mObjModelCriteria.FromVendorKey.trim() != '' && this.mObjModelCriteria.ToVendorKey.trim() != '') {
      if (this.mObjModelCriteria.FromVendorKey > this.mObjModelCriteria.ToVendorKey) {
        this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key11'));
        document.getElementById('txtVendorKeyTo').focus();
        pbSuccess = false;
      }
    }
    if (this.msCallType != "Vendor" && this.mObjModelCriteria.FromDocumentNo.trim() != '' && this.mObjModelCriteria.ToDocumentNo.trim() != '') {
      if (this.mObjModelCriteria.FromDocumentNo > this.mObjModelCriteria.ToDocumentNo) {
        this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key11'));
        document.getElementById('txtVoucherNoTo').focus();
        pbSuccess = false;
      }
    }
    if (String(this.mObjModelCriteria.From1099Type).trim() != '' && String(this.mObjModelCriteria.To1099Type).trim() != '') {
      if (this.mObjModelCriteria.From1099Type > this.mObjModelCriteria.To1099Type) {
        this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key11'));
        document.getElementById('txtTo1099Type').focus();
        pbSuccess = false;
      }
    }
    if (String(this.mObjModelCriteria.From1099Box).trim() != '' && String(this.mObjModelCriteria.To1099Box).trim() != '') {
      if (this.mObjModelCriteria.From1099Box > this.mObjModelCriteria.To1099Box) {
        this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key11'));
        document.getElementById('txtTo1099Box').focus();
        pbSuccess = false;
      }
    }
    if (this.msCallType != "Vendor") {
      const fromDate = new Date(this.mObjModelCriteria.FromDate);
      const toDate = new Date(this.mObjModelCriteria.ToDate);
      const fromResult = fromDate.getTime();
      const toResult = toDate.getTime();
      if (fromResult > toResult) {
        this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key6'));
        pbSuccess = false;
      }
      if (this.mObjModelCriteria.FromDate == undefined || this.mObjModelCriteria.FromDate == null) {
        this.mObjModelCriteria.FromDate = new Date('01/01/1900');
      }
      if (this.mObjModelCriteria.ToDate == undefined || this.mObjModelCriteria.ToDate == null) {
        this.mObjModelCriteria.ToDate = new Date();
      }
    }
    return pbSuccess;
  }
  /* Abhay/13-July-2020/Bug#141794 */
  bmlfonValidateLookupValue(pobjEvent) {
    let pbSuccess = true;
    if (pobjEvent.field == this.msLookupCaptionForVendor) {
      if (pobjEvent.eleId == "txtVendorKeyFrom" && this.mObjModelCriteria.ToVendorKey != "") {
        if (pobjEvent.value["Vendor_Key"].trim() > this.mObjModelCriteria.ToVendorKey.trim()) {
          pbSuccess = false;
          this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key11'));
          //this.mObjModelCriteria.FromVendorKey = "";
          document.getElementById(pobjEvent.eleId).focus();
        }
      } else if (pobjEvent.eleId == "txtVendorKeyTo" && this.mObjModelCriteria.FromVendorKey != "") {
        if (pobjEvent.value["Vendor_Key"].trim() < this.mObjModelCriteria.FromVendorKey.trim()) {
          pbSuccess = false;
          this.objToastService.notifyWarning(this.appUtility.bmgfonTranslate('Edit1099Information.Msg.Key11'));
          //this.mObjModelCriteria.ToVendorKey = "";
          document.getElementById(pobjEvent.eleId).focus();
        }
      }
    } else if (pobjEvent.field == this.msLookupCaptionForVoucher) {}
    return pbSuccess;
  }
