  bmlfReversalModal(event) {
    if (event == 'open') {
      this.mdtReversalDate = new Date(this.mObjModel.PaymentDate);
      this.mbReversalDialog = true;
    } else if (event == 'close') {
      this.mbReversalDialog = false;
    } else if (event == 'yes') {
      if (!src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_3__.CustomValidator.bmgfCompareTwoDates(this.mObjModel.PaymentDate, this.mdtReversalDate)) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('PAYMENTENTRY.MSG.REVERSALDATECHK'));
        this.mbReversalDialog = false;
        setTimeout(function () {
          document.getElementById('dtReversalDate').focus();
        }, 10);
        return false;
      }
      this.mbReversalDialog = false;
      this.bmlfReveralService();
    }
  }
