  bmlfSaveLookupField(pobjEvent) {
    let psInputDesKey = this.bmlfGetInputDesColumn(pobjEvent.field);
    this.mbIsLookupModal = false;
    if (pobjEvent.field == "Finance Series") {
      this.mObjModel.BatchSeries = pobjEvent.valueKey;
    } else if (pobjEvent.field == "Payment Mode") {
      this.mObjModel.PaymentMode = pobjEvent.valueKey;
      this.paymentModeCheck(pobjEvent.valueKey);
    } else if (pobjEvent.field == "Check Book") {
      this.mObjModel.TemplateID = '';
      this.mObjModel.ChqBookID = pobjEvent.valueKey;
      this.mObjModel.BankCurrency = pobjEvent.value.CurrencyKey;
      this.msBankName = pobjEvent.value.BankName;
      this.msAccountNo = pobjEvent.value.BankAcNo;
      this.msBankId = pobjEvent.value.BankID;
      this.mObjModel.BankID = pobjEvent.value.BankID;
      this.mnLastcheckNum = pobjEvent.value.LastChqNo;
      //this.bmlfGetBankCurrency(this.mObjModel.BankCurrency);
      this.bmlfCalCurrenyFacture(this.mObjModel.BankCurrency);
    } else if (pobjEvent.field == 'Vendor Class' && pobjEvent.type == 'from') {
      this.mObjModelSelectionCriteria.FromVendorClass = pobjEvent.valueKey;
      this.msFromVendorClassDesc = pobjEvent.value.Description;
    } else if (pobjEvent.field == 'Vendor Class' && pobjEvent.type == 'to') {
      this.mObjModelSelectionCriteria.ToVendorClass = pobjEvent.valueKey;
      this.msToVendorClassDesc = pobjEvent.value.Description;
    } else if (pobjEvent.field == 'Vendor' && pobjEvent.type == 'from') {
      this.mObjModelSelectionCriteria.FromVendorKey = pobjEvent.valueKey;
      this.msFromVendorKeyDesc = pobjEvent.value.VendorName;
    } else if (pobjEvent.field == 'Vendor' && pobjEvent.type == 'to') {
      this.mObjModelSelectionCriteria.ToVendorKey = pobjEvent.valueKey;
      this.msToVendorKeyDesc = pobjEvent.value.VendorName;
    } else if (pobjEvent.field == 'Voucher' && pobjEvent.type == 'from') {
      this.mObjModelSelectionCriteria.FromVoucher = pobjEvent.valueKey;
      this.msFromVoucherDate = moment__WEBPACK_IMPORTED_MODULE_1__(pobjEvent.value.Date).format(this.msCustomDateFormat.toUpperCase());
    } else if (pobjEvent.field == 'Voucher' && pobjEvent.type == 'to') {
      this.mObjModelSelectionCriteria.ToVoucher = pobjEvent.valueKey;
      this.msToVoucherDate = moment__WEBPACK_IMPORTED_MODULE_1__(pobjEvent.value.Date).format(this.msCustomDateFormat.toUpperCase());
    } else if (pobjEvent.field == "Bank Layout") {
      this.mObjModel.ChqBookID = '';
      this.mObjModel.TemplateID = pobjEvent.valueKey;
      this.mObjModel.BankCurrency = pobjEvent.value.CurrencyKey;
      this.msBankName = pobjEvent.value.BankName;
      this.msAccountNo = pobjEvent.value.BankAcNo;
      this.msBankId = pobjEvent.value.BankId;
      this.mObjModel.BankID = pobjEvent.value.BankId;
      this.bmlfGetBankCurrency(this.mObjModel.BankCurrency);
    } else if (pobjEvent.field == "Payment Range Processing") {
      this.mObjModel.DocNo = pobjEvent.valueKey.trim();
      if (this.mObjModel.DocNo != "") {
        //// Customization Refresh Url
        let jsonObj = {
          DocNo: this.mObjModel.DocNo
        };
        this.objUtils.refreshUrlAndInitCustom('/main/commondata/refresh', '/main/accountspayable/payment-range-processing/manage', true, jsonObj);
        //this.bmlfonURL(this.mObjModel[psInputDesKey]);
        this.bmlfGetDataOnLoad(this.mObjModel.DocNo);
      }
    }
    if (pobjEvent.field == "Vendor Details") {
      this.bmlfOnselectVendor(pobjEvent.value);
    }
    if (pobjEvent.field != "Payment Range Processing" && pobjEvent.field != "" && pobjEvent.field != "Vendor Details") {
      this.bmlfonChange();
    }
  }
