  //---------------------------------------------------------------------------------------
  bmlfValidateCriteria() {
    let pbResult = true;
    if (this.mObjModelSelectionCriteria.FromVendorClass != '' && this.mObjModelSelectionCriteria.ToVendorClass != '') {
      if (this.mObjModelSelectionCriteria.FromVendorClass > this.mObjModelSelectionCriteria.ToVendorClass) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('PAYMENTRANGEPROCESSING.MSG.TOKEYVALID'));
        pbResult = false;
      }
    }
    if (this.mObjModelSelectionCriteria.FromVendorKey != '' && this.mObjModelSelectionCriteria.ToVendorKey != '') {
      if (this.mObjModelSelectionCriteria.FromVendorKey > this.mObjModelSelectionCriteria.ToVendorKey) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('PAYMENTRANGEPROCESSING.MSG.TOKEYVALID'));
        pbResult = false;
      }
    }
    if (this.mObjModelSelectionCriteria.FromVoucher != null && this.mObjModelSelectionCriteria.ToVoucher != null) {
      if (this.mObjModelSelectionCriteria.FromVoucher > this.mObjModelSelectionCriteria.ToVoucher) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('PAYMENTRANGEPROCESSING.MSG.TOKEYVALID'));
        pbResult = false;
      }
    }
    if (pbResult == true) {
      if (this.mObjModelSelectionCriteria.FromVoucherDate != null && this.mObjModelSelectionCriteria.ToVoucherDate != null) {
        pbResult = src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_2__.CustomValidator.bmgfCompareTwoDates(this.mObjModelSelectionCriteria.FromVoucherDate, this.mObjModelSelectionCriteria.ToVoucherDate);
        if (pbResult == false) {
          this.objToastService.notifyError(this.objUtils.bmgfonTranslate('PAYMENTRANGEPROCESSING.MSG.DATEVALID'));
        }
      }
      if (this.mObjModelSelectionCriteria.FromDueDate != null && this.mObjModelSelectionCriteria.ToDueDate != null) {
        pbResult = src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_2__.CustomValidator.bmgfCompareTwoDates(this.mObjModelSelectionCriteria.FromDueDate, this.mObjModelSelectionCriteria.ToDueDate);
        if (pbResult == false) {
          this.objToastService.notifyError(this.objUtils.bmgfonTranslate('PAYMENTRANGEPROCESSING.MSG.DATEVALID'));
        }
      }
    }
    return pbResult;
  }
