  bmlfPostTransaction() {
    //check Write permission
    if (!this.objUtils.mbWrite) {
      this.objToastService.notifyWarning(this.objUtils.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
      return;
    }
    ;
    let parrFilterdArr = [];
    parrFilterdArr = this.marrAllVoucherList.filter(x => x.Sel == true);
    // Validation -S
    let pbResult;
    pbResult = this.bmlfonValidateFormData();
    if (pbResult == false) {
      return false;
    }
    if (this.mObjModel.PaymentMode.trim() == 'Check') {
      let pbCheck = false;
      parrFilterdArr.forEach(ele => {
        if (ele.ChequeNo == '') {
          pbCheck = true;
        }
      });
      if (pbCheck == true) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('PAYMENTRANGEPROCESSING.MSG.CHECKNOBLANK'));
        return false;
      }
    }
    // Validation -E
    if (this.mbChange == true) {
      this.msCallFor = "Post";
      this.mbShowDialog = true;
      return;
    }
    let reqData = {
      JSON: JSON.stringify({
        HeaderData: [{
          DocNo: this.mObjModel.DocNo
        }],
        Response: [{
          "ResponseText": "",
          "ErrorCode": ""
        }]
      })
    };
    this.mbIsLoading = true;
    this.objService.bmlfonPostPaymentRangeProcess(reqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res == null) {
        this.objToastService.notifyError('Server Error');
        return false;
      }
      if (res.Response[0].ErrorCode == "") {
        //this.objToastService.notifySuccess(this.objUtils.bmgfonTranslate('COMMON.MSG.SAVE'));
        this.msReport = res.Response[0].ResponseText;
        this.msAfterProcessMessage.screenName = this.msscreenName;
        this.msAfterProcessMessage.Data = res.Response[0].ResponseText;
        this.mbDescriptionDialog = true;
        this.bmlfPrintCheck();
      } else {
        if (res.Response[0].ResponseText.length > 80) {
          this.msReport = res.Response[0].ResponseText;
          this.msAfterProcessMessage.screenName = this.msscreenName;
          this.msAfterProcessMessage.Data = res.Response[0].ResponseText;
          this.mbDescriptionDialog = true;
        } else {
          this.objToastService.notifyError(res.Response[0].ResponseText);
        }
      }
    });
  }
