  //---------------------------------------------------------------------------------------
  bmlfonDeleteDialogAction(action) {
    if (action == 'No') {
      this.mbShowDeleteDialog = false;
    } else if (action == 'Yes') {
      if (this.msFormMode == "I" && (this.mbChange == true || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true)) {
        this.mbShowDeleteDialog = false;
        this.bmlfonClearControl();
        return;
      } else if (this.mbInsert && this.mbChange) {
        this.mbShowDeleteDialog = false;
        let deleteKey = this.msscreenName + " — " + this.mObjModel.DocNo;
        this.FieldExtender.bmgfDeleteData(deleteKey);
        this.bmlfonClearControl();
        this.objToastService.notifyWarning(this.objUtils.bmgfonTranslate('COMMON.MSGDELETE'));
        return false;
      }
      let reqData = {
        JSON: JSON.stringify({
          HeaderData: [{
            DocNo: this.mObjModel.DocNo.trim()
          }],
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.mbIsLoading = true;
      this.PaymentRangeProcessingService.bmlfonDDeletePaymentRangeProcess(reqData).subscribe(res => {
        this.mbIsLoading = false;
        if (res == null) {
          this.objToastService.notifyError('Server Error');
          return false;
        }
        if (res.Response[0].ErrorCode == "") {
          if (res.Response[0].ResponseText.search("Reference") != -1) {
            this.objToastService.notifyError(this.objUtils.bmgfonTranslate('COMMON.MSG.EXIST_REF'));
            this.mbShowDeleteDialog = false;
            return;
          } else if (res.Response[0].ResponseText.toUpperCase().search('DELETED') != -1 || res.Response[0].ResponseText.toUpperCase().search('SUCCESS') != -1) {
            this.mbShowDeleteDialog = false;
            this.objToastService.notifySuccess(this.objUtils.bmgfonTranslate('COMMON.MSG.DELETE'));
            this.bmlfonClearControl();
          } else {
            this.objToastService.notifySuccess(res.Response[0].ResponseText);
            this.mbShowDeleteDialog = false;
          }
        } else {
          this.objToastService.notifyError(res.Response[0].ResponseText);
          this.mbShowDeleteDialog = false;
        }
      });
    }
  }
