    if ((psField == 'KeyFrom' || psField == 'KeyTo') && this.msselectedType == 'Vendor') {
      psLookupTitle = 'APPLYPAYMENTREPORT.VENDORLOOKUP';
    } else if ((psField == 'KeyFrom' || psField == 'KeyTo') && this.msselectedType == 'Customer') {
      psLookupTitle = 'APPLYPAYMENTREPORT.CUSTOMERLOOKUP';
    } else if ((psField == 'DocumentNoFrom' || psField == 'DocumentNoTo') && this.msSelectedPostType == 'Debit No' && this.msselectedType == 'Vendor') {
      psLookupTitle = 'APPLYPAYMENTREPORT.DEBITNOTELOOKUP';
    } else if ((psField == 'DocumentNoFrom' || psField == 'DocumentNoTo') && this.msSelectedPostType == 'Debit No' && this.msselectedType == 'Customer') {
      psLookupTitle = 'APPLYPAYMENTREPORT.ARINVOICELOOKUP';
    } else if ((psField == 'DocumentNoFrom' || psField == 'DocumentNoTo') && this.msSelectedPostType == 'Payment No') {
      psLookupTitle = 'APPLYPAYMENTREPORT.PAYMENTENTRYLOOKUP';
    }
    return psLookupTitle;
