  //  Set Lookup Description Column
  bmlfGetInputDesColumn(psField) {
    if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Vendor') {
      return 'VendorName';
    } else if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Customer') {
      return 'Customer_Name';
    } else if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Miscellaneous') {
      return 'Description';
    }
  }
  // Set Lookup KEY
  bmlfonSetLookupKey(psField, printType) {
    let psLookUpKey;
    if (psField == 'From' && printType == 'Vendor') {
      return psLookUpKey = 'VendorFrom';
    } else if (psField == 'To' && printType == 'Vendor') {
      return psLookUpKey = 'VendorTo';
    } else if (psField == 'From' && printType == 'Customer') {
      return psLookUpKey = 'CustomerFrom';
    } else if (psField == 'To' && printType == 'Customer') {
      return psLookUpKey = 'CustomerTo';
    } else if (psField == 'From' && printType == 'Miscellaneous') {
      return psLookUpKey = 'MiscellaneousFrom';
    } else if (psField == 'To' && printType == 'Miscellaneous') {
      return psLookUpKey = 'MiscellaneousTo';
    } else if (psField == 'NumberFrom') {
      return psLookUpKey = 'PaymentNoFrom';
    } else if (psField == 'NumberTo') {
      return psLookUpKey = 'PaymentNoTo';
    }
    return psLookUpKey;
  }
  bmlfSetLookupTitle(psField) {
    let psLookupTitle;
    if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Vendor') {
      psLookupTitle = 'PAYMENTREPORT.VENDORLOOKUP';
    } else if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Customer') {
      psLookupTitle = 'PAYMENTREPORT.CUSTOMERLOOKUP';
    } else if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Miscellaneous') {
      psLookupTitle = 'PAYMENTREPORT.MISCELLANEOUSLOOKUP';
    } else if (psField == 'NumberFrom' || psField == 'NumberTo') {
      psLookupTitle = 'PAYMENTREPORT.PAYMENTENTRYLOOKUP';
    }
    return psLookupTitle;
  }
  // get Lookup Value Column
  bmlfGetInputColumn(psField) {
    if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Vendor') {
      return 'Vendor_Key';
    } else if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Customer') {
      return 'Customer_Key';
    } else if ((psField == 'From' || psField == 'To') && this.msselectedType == 'Miscellaneous') {
      return 'Acct';
    } else if (psField == 'NumberFrom' || psField == 'NumberTo') {
      return 'PaymentNo';
    }
  }
