  //---------------------------------------------------------------------------------------
  bmlfGetDefault() {
    this.bmlfGetPrecision();
    this.msTDSImplement = "No";
    let parrDefaultAppSetup = JSON.parse(localStorage.getItem("DistributionParameter"));
    if (parrDefaultAppSetup) {
      parrDefaultAppSetup.forEach(ele => {
        if (ele.DEFAULT_KEY == 'Tax_Type') {
          this.msAppTaxType = ele.DEFAULT_VALUE;
        }
        if (ele.DEFAULT_KEY.toUpperCase() == 'TDS_IMPLEMENTED') {
          if (ele.DEFAULT_VALUE.toUpperCase() == 'YES') {
            //this.msTDSImplement = ele.DEFAULT_VALUE;
            this.msTDSImplement = "Yes";
          }
        }
      });
    }
  }
  //---------------------------------------------------------------------------------------
  GetDefaultSeries() {
    //+++++++++++++ Default Series  ++++++++++++++++++++++++++
    let pobjReqData = {
      ScreenName: 'VendorDebitNoteComponent',
      LookUpKey: 'VendorDebitNoteSeries',
      Filter1: this.msscreenName,
      Filter2: this.msRecUserID
    };
    this.userService.GETGeneralSqlData(pobjReqData).subscribe(res => {
      if (res.LookupData.length > 0) {
        this.mObjModel.Ticketno = res.LookupData[0].DefaultSeries;
        setTimeout(function () {
          document.getElementById('txtVendkey').focus();
        }, 10);
      } else {
        setTimeout(function () {
          document.getElementById('txtTicketno').focus();
        }, 10);
      }
    });
  }
  bmlfFinSetupDefault() {
    this.msTDSImplement = "No";
    let pobjReqData = {
      ScreenName: 'VendorDebitNoteComponent',
      LookUpKey: 'TDSIMPLEMENTED'
    };
    this.userService.GETGeneralSqlData(pobjReqData).subscribe(res => {
      if (res.LookupData.length > 0) {
        res.LookupData.forEach(ele => {
          if (ele.Default_key.toUpperCase() == 'TAX_TYPE') {
            this.msAppTaxType = ele.Default_Value;
          }
          if (ele.Default_key.toUpperCase() == 'TDS_IMPLEMENTED') {
            if (ele.Default_Value.toUpperCase() == 'YES') {
              this.msTDSImplement = "Yes";
            }
          }
        });
      }
    });
  }
  bmlfTDSShowColumn() {
    this.mArrVendorDebitGrid.forEach(col => {
      if (col.Field == "TDSAmt" || col.Field == "TDSRate" || col.Field == "TDSType") {
        col.Display = false;
      }
    });
  }
