  //-----------------------------------------------------------------------------------
  bmlfonValidateFormData(action) {
    if (action == 'PROCESS') {
      if (this.mObjModel.VendorFrom.trim() != '' && this.mObjModel.VendorTo.trim() != '') {
        if (this.mObjModel.VendorFrom > this.mObjModel.VendorTo) {
          this.objToastService.notifyError(this.objUtils.bmgfonTranslate('WRITEOFFVENDORDOCUMENTS.MSG.VENDORVALID'));
          document.getElementById('txtVendorFrom').focus();
          return;
        }
      } else if (this.mObjModel.CurrencyKey == "") {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('WRITEOFFVENDORDOCUMENTS.MSG.CURRENCYKEY'));
        setTimeout(function () {
          document.getElementById('txtCurrencyKey').focus();
        }, 10);
        return false;
      }
    }
    if (action == 'POST') {
      if (this.mObjModel.ApplyDate < this.mObjModel.CutOffDate) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('WRITEOFFVENDORDOCUMENTS.MSG.APPLYDATECHECK'));
        setTimeout(function () {
          document.getElementById('dateApplyDate').focus();
        }, 10);
        return false;
      }
      if (this.mObjModel.BatchSeries == "") {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('WRITEOFFVENDORDOCUMENTS.MSG.BATCHSERIESCHK'));
        setTimeout(function () {
          document.getElementById('txtBatchSeries').focus();
        }, 10);
        return false;
      }
      if (this.maarraySelected.length == 0) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('WRITEOFFVENDORDOCUMENTS.MSG.SLECTDOC'));
        return false;
      }
    }
  }
